Meteor.startup(() => {
  Tracker.autorun(() => {
    const user = Meteor.user();
    if (user && user.customFields) {
      for (const [key, value] of Object.entries(user.customFields)) {
        let finalValue = Array.isArray(value) ? value[0] : value;

        const grupoMap = ['sales', 'treinamento', 'adm de contas', 'edona'];
        if (key === 'grupo' && typeof finalValue === 'number') {
          finalValue = grupoMap[finalValue] || `grupo-${finalValue}`;
        }

        if (finalValue) {
          const className = `custom-${key}-${String(finalValue).toLowerCase().replace(/\s+/g, '-')}`;
          document.body.classList.add(className);
        }
      }
    }
  });
});

